      <text id="9" justification="0" size="4" underlined="false">
        <text>52) In un gioco i personaggi vengono costruiti assemblando varie parti del corpo: arti, al massimo 4, di cui si sceglie il
colore e una percentuale di forza per sferrare i colpi, gambe massimo 2, di cui si sceglie il colore e la lunghezza.
Inoltre ci sono delle armi che possono essere usate dai vari personaggi, e sono caratterizzate da un nome, una
potenza e un percentuale di ricarica. Ogni mostro può avere al massimo un’arma per arto. Inoltre i mostri possono
avere dei vestiti: un cappello, una maglia, un pantalone. Di ciascun abbigliamento si può scegliere il colore. Creare
una classe test che visualizzi il mostro creato e la sua forza totale negli arti e nelle armi.</text>
      </text>
